"use strict";
class Cep {
    constructor(obj) {
        this.cep = obj.cep;
        this.logradouro = obj.logradouro;
        this.complemento = obj.complemento;
        this.unidade = obj.unidade;
        this.bairro = obj.bairro;
        this.localidade = obj.localidade;
        this.uf = obj.uf;
        this.ibge = obj.ibge;
        this.gia = obj.gia;
        this.ddd = obj.ddd;
        this.siafi = obj.siafi;
    }
}
